        if(result.user){
            result = await result.json();
            
        }
        else{
            console.log("Not current user")
        }
    }

    return(
        <div className="card">
        <div className="search">
            <input type="text" placeholder="Write something here..."/>
            <button onClick={addTodo} >âž•</button>
        </div>
        
        
    </div>
